import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Education extends Component {
    render() {
        return (
            <Grid>
                <Cell col={4}>
                    <div>
                        <p> {this.props.startYear} </p>

            </div>
            </Cell>
            </Grid>
        )
    }
}

export default Education;
